import React from 'react';
import './Home.css';

function Home() {
  return (
    <div className="home">
      <section className="hero">
        <h1>Meet Rosie</h1>
        <p>Your AI-powered assistant for seamless business communication.</p>
        <a href="/booking" className="hero-btn">Book a Demo</a>
      </section>
      <section className="features-preview">
        <h2>Why Rosie?</h2>
        <ul>
          <li>24/7 AI Chat Support</li>
          <li>Easy Integration</li>
          <li>Customizable Workflows</li>
        </ul>
      </section>
    </div>
  );
}

export default Home;
